description:
Dreading moments to come. Caught in a pool of negative thoughts. Hard to escape. Hard to control. You've been busted.

///

Anxious Process is a series consisting of 3 digital abstract artworks. Each piece represents a certain state of a dispirited, anxious mind. The visuals and descriptions associated with each objkt are a reflection of my struggles with mental health, specifically during the year of 2020.

///

